import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

document.body.style.background="repeating-linear-gradient(45deg, #007bff 10px, transparent 10px, transparent 20px, #007bff 20px);"

let users = [
  { name: 'moein', age: 20, gen: "mel" },
  { name: 'sadaf', age: 21, gen: "famel" },
  { name: 'sahar', age: 22, gen: "famel" }
]

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <App {...users} />
  </>
);
